import './App.css';
import React from 'react'; 
import Navbar from './components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './pages/Shop';
import ShopCategory from './pages/ShopCategory';
import Recipe from './pages/Recipe';
import LoginSignUp from './pages/LoginSignUp';
import Footer from './components/Footer/Footer';
import valorant_banner from './components/assets/velikonocni-cupcaky.jpg'
import sapnap_banner from './components/assets/velikonocni-cupcaky.jpg'
import random_banner from './components/assets/velikonocni-cupcaky.jpg'
import Hero from './components/Hero/Hero';


function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='/valorant' element={<ShopCategory banner={valorant_banner} category="valorant"/>}/>
        <Route path='/sapnap' element={<ShopCategory banner={sapnap_banner} category="sapnap"/>}/>
        <Route path='/random' element={<ShopCategory banner={random_banner} category="random"/>}/>
        <Route path='/recipe' element={<Recipe/>}>
          <Route path=':recipeId' element={<Recipe/>}/>
        </Route>
        <Route path='/login' element={<LoginSignUp/>}/>
        <Route path='/' element={<Home/>}/>
      </Routes>
      <Hero/>
      <Footer/>
      </BrowserRouter>


    </div>
  );
}

export default App;
